import React, { useState } from 'react';
import './SignUp.css';

const SignupForm = () => {
  const [form, setForm] = useState({
    email: '',
    dateOfBirth: '',
    phone: '',
    username: '',
    password: '',
    repassword: '',
  });

  const [errors, setErrors] = useState({});
  const [isSuccessful, setIsSuccessful] = useState(false);
  const [isSignUpFailed, setIsSignUpFailed] = useState(false);
  const [errorMessage, setErrorMessage] = useState('');

  const validate = () => {
    const newErrors = {};
    // ... validations similaires
    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const onSubmit = (e) => {
    e.preventDefault();
    if (validate()) {
      setIsSuccessful(true);
      setIsSignUpFailed(false);
    } else {
      setIsSignUpFailed(true);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm({ ...form, [name]: value });
  };

  return (
    <form className="signup-form-login" onSubmit={onSubmit}>
      <div className="signup-card-container">
        <h2 className="signup-form-login-heading">INSCRIVEZ-VOUS MAINTENANT</h2>
        
        {!isSuccessful && (
          <div className="signup-login-wrap">
            <div className="signup-form-row">
              <div className="signup-col-6">
                <label htmlFor="email">E-mail</label>
                <input
                  type="email"
                  className={`signup-form-control ${errors.email ? 'is-invalid' : ''}`}
                  name="email"
                  value={form.email}
                  onChange={handleChange}
                  placeholder="Email"
                  required
                />
                <small className="text-danger">{errors.email}</small>
              </div>

              <div className="signup-col-6">
                <label htmlFor="dateOfBirth">Date de naissance</label>
                <input
                  type="date"
                  className={`signup-form-control ${errors.dateOfBirth ? 'is-invalid' : ''}`}
                  name="dateOfBirth"
                  value={form.dateOfBirth}
                  onChange={handleChange}
                  required
                />
                <small className="text-danger">{errors.dateOfBirth}</small>
              </div>
            </div>

            <div className="signup-form-row">
              <div className="signup-col-6">
                <label htmlFor="phone">Téléphone</label>
                <input
                  type="tel"
                  className={`signup-form-control ${errors.phone ? 'is-invalid' : ''}`}
                  name="phone"
                  value={form.phone}
                  onChange={handleChange}
                  placeholder="Téléphone"
                  required
                />
                <small className="text-danger">{errors.phone}</small>
              </div>

              <div className="signup-col-6">
                <label htmlFor="username">Nom d'utilisateur</label>
                <input
                  type="text"
                  className={`signup-form-control ${errors.username ? 'is-invalid' : ''}`}
                  name="username"
                  value={form.username}
                  onChange={handleChange}
                  placeholder="Nom d'utilisateur"
                  required
                />
                <small className="text-danger">{errors.username}</small>
              </div>
            </div>

            <div className="signup-form-row">
              <div className="signup-col-6">
                <label htmlFor="password">Mot de passe</label>
                <input
                  type="password"
                  className={`signup-form-control ${errors.password ? 'is-invalid' : ''}`}
                  name="password"
                  value={form.password}
                  onChange={handleChange}
                  placeholder='Mot de passe'
                  required
                />
                <small className="text-danger">{errors.password}</small>
              </div>

              <div className="signup-col-6">
                <label htmlFor="repassword">Confirmez le mot de passe</label>
                <input
                  type="password"
                  className={`signup-form-control ${errors.repassword ? 'is-invalid' : ''}`}
                  name="repassword"
                  value={form.repassword}
                  onChange={handleChange}
                  placeholder='Mot de passe'
                  required
                />
                <small className="text-danger">{errors.repassword}</small>
              </div>
            </div>

            <button className="signup-btn signup-btn-theme signup-btn-block" type="submit">
              <i className="fa fa-lock"></i> S'inscrire
            </button>

            {isSignUpFailed && (
              <div className="signup-alert">
                L'inscription a échoué !<br />{errorMessage}
              </div>
            )}
          </div>
        )}

        {isSuccessful && <div className="signup-success">Vous vous êtes inscrit avec succès</div>}
      </div>
    </form>
  );
};

export default SignupForm;
